  font-size: 50px;
  color: ${({ theme }) => theme.colors.primary};
`;

export default function Home() {
  return (
    <>
      <Title>Nextjs Component Preview</Title>
      <Button primary>test</Button>
      <ButtonGov primary>test</ButtonGov>
    </>
  );
}
